   public static boolean entityHasEmote(LivingEntity entity) {
      return emotelist.containsKey(entity.getUniqueId().toString());
   }

   public static CustomEmote emoteFromName(String name) throws NoSuchEmoteException {
      EmoteType emoteType = EmoteType.fromName(name);
      CustomEmote emote;
      if (emoteType != null) {
         emote = emoteType.initEmote();
      } else {
         if (!SkullConfig.emoteExists(name)) {
            throw new NoSuchEmoteException(name);
         }

         emote = SkullConfig.getEmote(name);
      }

      return emote;
   }

   public static void playEmote(CustomEmote emote, LivingEntity entity) {
      playEmote(emote, entity, 0, 0L);
   }

   public static void playEmote(final CustomEmote emote, final LivingEntity entity, int repeats, long tick) {
      if (!emotelist.containsKey(entity.getUniqueId().toString())) {
         originalItem.put(entity.getUniqueId().toString(), getHelmet(entity));
         String skullName = "§b§lEMOTE-" + entity.getUniqueId().toString();
         final List skulls = new ArrayList();

         int custom;
         for(custom = 0; custom < emote.size(); ++custom) {
            skulls.add(createSkull(skullName, emote.getFrameData(custom)));
         }

         custom = Bukkit.getServer().getScheduler().runTaskTimer(skDragonCore.skdragoncore, new Runnable(repeats) {
            int time = 0;
            int skullStep = 0;
            int timeCounter = 0;
            int i;
            boolean repeating;

            {
               this.i = var1;
               this.repeating = var1 >= 1;
            }

            public void run() {
               if (emote.getEmoteType() != null) {
                  emote.getEmoteType().playParticle(this.time, this.skullStep, entity.getEyeLocation());
               }

               if (this.time == this.timeCounter) {
                  this.timeCounter += emote.getFrameLength(this.skullStep);
                  SkullEffectsLib.setHelmet(entity, (ItemStack)skulls.get(this.skullStep));
                  ++this.skullStep;
               }

               ++this.time;
               if (this.repeating) {
                  if (this.time >= emote.getTotalLength()) {
                     this.time = 0;
                     this.skullStep = 0;
                     this.timeCounter = 0;
                     --this.i;
                  }

                  if (this.i < 1) {
                     SkullEffectsLib.stopEmote(entity);
                  }
               } else if (this.time >= emote.getTotalLength()) {
                  SkullEffectsLib.stopEmote(entity);
               }

            }
         }, 0L, tick).getTaskId();
         emotelist.put(entity.getUniqueId().toString(), custom);
         Bukkit.getServer().getPluginManager().callEvent(new EmoteStartedEvent(emote.getName(), entity));
      }

   }

   public static void stopEmote(LivingEntity ent) {
      if (emotelist.containsKey(ent.getUniqueId().toString())) {
         giveBackOriginal(ent);
         Bukkit.getScheduler().cancelTask((Integer)emotelist.get(ent.getUniqueId().toString()));
         emotelist.remove(ent.getUniqueId().toString());
         Bukkit.getServer().getPluginManager().callEvent(new EmoteEndedEvent(ent));
      }

   }

   private static void setHelmet(LivingEntity ent, ItemStack helmet) {
      (new SkullPacket(ent, helmet)).sendTo(100.0D);
   }

   private static ItemStack getHelmet(LivingEntity ent) {
      EntityEquipment ee = ent.getEquipment();
      return ee.getHelmet();
   }

   private static void giveBackOriginal(LivingEntity ent) {
      if (originalItem.containsKey(ent.getUniqueId().toString())) {
         System.out.println(originalItem.get(ent.getUniqueId().toString()));
         (new SkullPacket(ent, (ItemStack)originalItem.get(ent.getUniqueId().toString()))).sendTo(100.0D);
         originalItem.remove(ent.getUniqueId().toString());
      }

   }

   private static void removeSkull(LivingEntity ent) {
      ItemStack[] var4;
      int var3 = (var4 = ent.getEquipment().getArmorContents()).length;

      for(int var2 = 0; var2 < var3; ++var2) {
         ItemStack item = var4[var2];
         if (item != null) {
            System.out.println(item.getType());
            if (item.hasItemMeta() && item.getItemMeta().hasDisplayName() && item.getItemMeta().getDisplayName().equals("§b§lEMOTE-" + ent.getUniqueId().toString())) {
               giveBackOriginal(ent);
            }
         }
      }

   }

   public static ItemStack createSkull(String name, String url) {
      ItemStack head = null;

      try {
         head = new ItemStack(Material.valueOf("SKULL_ITEM"), 1, (short)3);
      } catch (IllegalArgumentException var8) {
         head = new ItemStack(Material.valueOf("PLAYER_HEAD"), 1);
      }

      if (url.isEmpty()) {
         return head;
      } else {
         SkullMeta headMeta = (SkullMeta)head.getItemMeta();
         GameProfile profile = new GameProfile(UUID.randomUUID(), (String)null);
         profile.getProperties().put("textures", new Property("textures", url));

         try {
            Field profileField = headMeta.getClass().getDeclaredField("profile");
            profileField.setAccessible(true);
            profileField.set(headMeta, profile);
         } catch (IllegalArgumentException | IllegalAccessException | NoSuchFieldException var7) {
            var7.printStackTrace();
         }

         headMeta.setDisplayName(name);
         head.setItemMeta(headMeta);
         return head;
      }
   }
